svg.script:
function toggleCheck(object) {
	var 
		objectId,
		objectPrefix,
		box,
		group;

	// Cast the object's ID to a string.
	objectId = '' + object.id;
	// Remove any checkbox or check_label suffixes.
	objectPrefix = objectId.replace('checkbox', '').replace('check_label', '');
	// Get the associated checkbox.
	box = document.getElementById(objectPrefix + 'box');
	// Get the associated group.
	group = document.getElementById(objectPrefix + 'group');
	// Toggle the opacity of the box to make the X appear and toggle to group display.
	if (box.style.fillOpacity === '1') {
		// Checked
		box.style.fillOpacity = '0';
		group.style.display = 'inline';
	} else {
		// Not checked
		box.style.fillOpacity = '1';
		group.style.display = 'none';
	}
}

function toggleCircuits(object, highlight) {
	var 
		objectId,
		objectPrefix,
		checkLabel;

	// Cast the object's ID to a string.
	objectId = '' + object.id;
	// Remove the group suffix.
	objectPrefix = objectId.replace('group', '');
	// Get the associated check label.
	checkLabel = document.getElementById(objectPrefix + 'check_label');
	// Set the label to black.
	checkLabel.style.fill = '#000000';
	// Determine if we are highlighting a circuit.
	if (highlight === true) {
		checkLabel.style.fill = '#ff0000';
	}
}

function toggleAll(checkAll) {
	var
		i,
		objectPrefix,
		group,
		box,
		objectsArr = [
			'circuit_13',
			'circuit_15',
			'circuit_16',
			'circuit_19',
			'objects',
			'doors'
		];

	// Loop on the objects array
	for (i = 0; i < objectsArr.length; i++) {
		// Get the associated checkbox.
		box = document.getElementById(objectsArr[i] + '_box');
		// Get the associated group.
		group = document.getElementById(objectsArr[i] + '_group');
		// Toggle the opacity of the box to make the X appear and toggle to group display.
		if (checkAll === true) {
			// Checked
			box.style.fillOpacity = '0';
			group.style.display = 'inline';
		} else {
			// Not checked
			box.style.fillOpacity = '1';
			group.style.display = 'none';
		}
	}

}
